	}
	
	$buttonSave_Click = {
		if ($script:OffWeek-ne 0 -and $script:OffWeek2 -ne 0)
		{
			$formConfig.Close()
			$global:VacationWeek = $OffWeek
			$global:VacationWeek2 = $OffWeek2
		}
		else
		{
			[System.Windows.Forms.MessageBox]::Show("Please select an item from each drop down list.","Mjolnir Configuration",'OK')
		}
	}
	
