		 Author Comments
	
		This script's purpose is to test and create a similar function backend like that of P&G's simulation game.
	#>
	<#
		.SYNOPSIS
			MJOLNIR attempts to recreate the work of P&G's simulation game.
		
		.DESCRIPTION
			MJOLNIR simulates a production environment where a manager, AKA the user, must adequately prepare inventory and production rates 
			over the course of 52 weeks. Please see the README file for more information.
	#>
	#endregion
